### Minimal, reproducible example

```TypeScript
let browser;
let executablePath;

async function launchBrowser() {
        if (executablePath) {
                try {
                        console.log("launching by exe path");
                        return await puppeteer.launch({
                                executablePath,
                                args: ["--no-sandbox", "--disable-setuid-sandbox"],
                        });
                } catch (e) {
                        log("Error with exe path:", e);
                }
        }
        try {
                console.log("launching by default path");
                return await puppeteer.launch();
        } catch (e) {
                log("caught:", e);
                log("FINDING exe PATH");
                executablePath = await new Promise((res, rej) =>
                        exec("which chromium", (err, out, stderr) => {
                                if (stderr || err) {
                                        rej(stderr || err);
                                } else {
                                        res(out.trim());
                                }
                        })
                );
                log(executablePath);
                return await launchBrowser();
        }
}


async function initBrowser() {
        console.log("init browser");
        if (!browser) {
                console.log("no browser yet");
                browser = await launchBrowser();
                console.log("returning new browser");
        }
        console.log("returning existing browser");
        return browser;
}

initBrowser().then(() => console.log('Browser initialized'))
```


### Error string

none

### Bug behavior

- [ ] Flaky
- [ ] PDF

### Background

I've been using older version of puppeteer (19) without a problem. But version 21 doesn't work.
I'm running a docker container on an Oracle Ampere machine (arm64) 
Chromium is installed by docker using `RUN apt-get install chromium -y`
Docker image is `node:gallium-buster`


### Expectation

Browser should start and should be accessible.

### Reality

Process hangs and does nothing. 
First time it fails because it is not able to run chrome that comes installed with puppeteer. Then it looks up chromium installed by apt and it seems that it is okay. I get a message about deprecated headless mode. But then it hangs. I can see chromium process started by examining `ps -aux` there is e.g. 
```
root        1041  0.0  0.2 38804488 65652 ?      Sl   01:03   0:00 /usr/lib/chromium/chromium --type=renderer --no-sandbox --disable-dev-shm-usage --disable-background-timer-throttling --disable-breakpad --enable-automation --file-url-path-alias=/gen=/usr/lib/chromium/gen --force-color-profile=srgb --remote-debugging-port=0 --allow-pre-commit-input --field-trial-handle=11772390256001659433,12411231457055470110,131072 --enable-features=NetworkServiceInProcess2 --disable-features=AcceptCHFrame,MediaRouter,OptimizationHints,Prerender2,Translate --enable-blink-features=IdleDetection --lang=en-US --headless --export-tagged-pdf --lang=en-US --num-raster-threads=2 --enable-main-frame-before-activation --renderer-client-id=4 --shared-files=v8_context_snapshot_data:100
```

I stepped through puppeteer code and it seems that puppeteer doesn't receive any message or notification from chromium, that chromium is started.

During stepping I've encountered a message 
```
[1006/004426.742522:ERROR:bus.cc(393)] Failed to connect to the bus: Failed to connect to socket /var/run/dbus/system_bus_socket: No such file or directory
```
but it seems like it then switched to ws which probably connected but there was no communication. But those are only my guesses.

